import React, { useEffect, useState } from "react";

const OwnersTable = () => {
  const [owners, setOwners] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/owners_list", { credentials: "include" })
      .then((res) => res.json())
      .then((data) => {
        if (data.success) {
          setOwners(data.owners);
        } else {
          setError(data.message || "Failed to fetch owners");
        }
        setLoading(false);
      })
      .catch((err) => {
        console.error(err);
        setError("Error fetching owners");
        setLoading(false);
      });
  }, []);

  if (loading) return <p>Loading owners...</p>;
  if (error) return <p>{error}</p>;
  if (!owners.length) return <p>No owners found.</p>;

  return (
    <div style={{ overflowX: "auto" }}>
      <table
        border="1"
        cellPadding="8"
        style={{ borderCollapse: "collapse", minWidth: "100%" }}
      >
        <thead>
          <tr>
            <th>Owner Code</th>
            <th>Salutation</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Nationality</th>
            <th>Address1</th>
            <th>Address2</th>
            <th>City</th>
            <th>State</th>
            <th>Country</th>
            <th>Zip Code</th>
            <th>Mobile</th>
            <th>Email</th>
            <th>Passport Number</th>
            <th>Date of Birth</th>
            <th>Visa Expiry</th>
            <th>Passport Expiry</th>
            <th>EID Image</th>
            <th>Passport Copy</th>
            <th>Residence Visa</th>
            <th>Created By</th>
            <th>Approved By</th>
          </tr>
        </thead>
        <tbody>
          {owners.map((owner) => (
            <tr key={owner.owner_code}>
              <td>{`OW${owner.owner_code.toString().padStart(5, "0")}`}</td>
              <td>{owner.salutation}</td>
              <td>{owner.first_name}</td>
              <td>{owner.last_name}</td>
              <td>{owner.nationality}</td>
              <td>{owner.address1}</td>
              <td>{owner.address2}</td>
              <td>{owner.city}</td>
              <td>{owner.state}</td>
              <td>{owner.country}</td>
              <td>{owner.zip_code}</td>
              <td>{owner.mobile_number}</td>
              <td>{owner.email}</td>
              <td>{owner.passport_number}</td>
              <td>{owner.date_of_birth}</td>
              <td>{owner.visa_expiry_date}</td>
              <td>{owner.passport_expiry_date}</td>
              <td>
                {owner.eid_image && (
                  <img
                    src={`data:image/jpeg;base64,${owner.eid_image}`}
                    alt="EID"
                    width={50}
                  />
                )}
              </td>
              <td>
                {owner.passport_copy && (
                  <img
                    src={`data:image/jpeg;base64,${owner.passport_copy}`}
                    alt="Passport"
                    width={50}
                  />
                )}
              </td>
              <td>
                {owner.res_visa && (
                  <img
                    src={`data:image/jpeg;base64,${owner.res_visa}`}
                    alt="Visa"
                    width={50}
                  />
                )}
              </td>
              <td>{owner.created_by}</td>
              <td>{owner.approved_by}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OwnersTable;
